report.cwrRadioPhyTable.cwrCableLoss.description=This object represents the measured loss in signal power in dB that is imposed by the cable connecting the radio to the antenna head. This value enables the hardware to compensate for the cable loss by adjusting the gain appropriately. A value of 0 represents no degradation in signal due to the cable. This cable loss applies to the transmit antenna identified by cwrTxRfIndex.
