report.cwrSnapshotCtrlTable.cwrSnapshotType.name=CISCO-WIRELESS-IF-MIB::cwrSnapshotCtrlTable::cwrSnapshotType
report.cwrSnapshotCtrlTable.cwrSnapshotType.columns=cwrSnapshotType
report.cwrSnapshotCtrlTable.cwrSnapshotType.type=cwrSnapshotCtrlEntry
report.cwrSnapshotCtrlTable.cwrSnapshotType.description=This object represents the attribute that is being snapshoted by the hardware. When a snapshot request is issued up to 4 simultaneous radio signal attribute may be captured at once. The 4 attributes are specified by bit OR'ing the snapshot types identified below. When a snapshot specification is started all the specified attributes are captured simultaneously. The TX and RX types cannot be mixed. RX, Sync types can be mixed. When a snapshot request is issued up to four radio signal attributes may be requested at once, one from each set: =============================================== Type Set1 Set2 =============================================== RX y1n(x1) y2n(x2) H2k(x80) H1k(x40) - - Sync - FreqCorr(x8000) - FLL_FFT_Sp(x20000) TX CodecIn(x200) IFFTIn(x400) =============================================== =============================================== Type Set3 Set4 =============================================== RX Y2k(x8) Y1k(x4) h1n(x10) h2n(x20) zhat(x100) - Sync FreqOffCF(x2000)(*) BrstTimeCF(x1000)(*) - TT_FCorr(x10000) TX - RoundOut(x800) =============================================== (*) BrstTimeCF cannot be mixed with Set2 (*) FreqOffCF cannot be mixed with Set1 Note that only the Tx* attributes may be captured on DSP's 1, 2. The attributes are: RxRawBurstAnt1Y1n(0x01): This represents a snapshot of the received signal for RF resource 1. For every sample the real and imaginary components are captured. Units: (I, q) Value: 32 bit quantities. RxRawBurstAnt2Y2n(0x02): This represents a snapshot of the received signal for RF resource 2. For every sample the real and imaginary components are captured. Units: (I, q) Value: 32 bit quantities. RxSpectrumAnt1Y1k(0x04): This represents a snapshot of the spectrum of the received signal for RF resource 1. For every sample the real and imaginary components are captured. Units: (I, q) Value: 32 bit quantities. RxSpectrumAnt2Y2k(0x08): This represents a snapshot of the spectrum of the received signal for RF resource 2. For every sample the real and imaginary components are captured. Units: (I, q) Value: 32 bit quantities. RxTimeDomainChannelAnt1H1n(0x10): This represents a snapshot of the time domain channel for RF resource 1. For every sample the real and imaginary components are captured. Units: (I, q) Value: 32 bit quantities. RxTimeDomainChannelAnt2H2n(0x20): This represents a snapshot of the time domain channel for RF resource 2. For every sample the real and imaginary components are captured. Units: (I, q) Value: 32 bit quantities. RxFreqDomainChannelAnt1H1k(0x40): This represents a snapshot of the frequency domain channel for RF resource 1. For every sample the real and imaginary components are captured. Units: (I, q) Value: 32 bit quantities. RxFreqDomainChannelAnt2H2k(0x80), This represents a snapshot of the frequency domain channel for RF resource 2. For every sample the real and imaginary components are captured. Units: (I, q) Value: 32 bit quantities. RxConstellationZHatk(0x100): This represents a snapshot of the soft decisions. For every sample the real and imaginary components are captured. Units: (I, q) Value: 32 bit quantities. TxCodecInput(0x200): This represents a snapshot of input values to the Tx Code. Units: Real values. Value: 32 bit quantities. TxIFFTInput(0x400): This represents a snapshot of the IFFT signal for the Transmitted data. For every sample the real and imaginary components are captured. Units: (I, q) Value: 32 bit quantities. TxRoundOutput(0x800): This represents a snapshot of the Rounded Constellation signal for the Transmitted data. For every sample the real and imaginary components are captured. Units: (I, q) Value: 32 bit quantities. SyncBurstTimeCostFunc(0x1000): This represents the timing cost function for Sync bursts. Units: Real values. Value: 32 bit quantities. SynFreqOffsetCostFunc(0x2000): This represents a snapshot of the frequeny offsets. For every sample the real and imaginary components are captured. Units: (I, q) Value: 32 bit quantities. SyncFllFreqCorrelation(0x8000): This represents a snapshot of Frequency correlation. For every sample the real and imaginary components are captured. Units: (I, q) Value: 32 bit quantities. SyncFllTrainToneCorrelation(0x10000): This represents a snapshot of Frequency locked loop's Training tone correlation. For every sample the real and imaginary components are captured. Units: (I, q) Value: 32 bit quantities. SyncFllFFTSpectrum(0x20000): This represents a snapshot of Frequency locked loop, FFT Spectrum. For every sample the real and imaginary components are captured. Units: (I, q) Value: 32 bit quantities.
report.cwrSnapshotCtrlTable.cwrSnapshotType.command=--title="CISCO-WIRELESS-IF-MIB::cwrSnapshotCtrlTable::cwrSnapshotType" \
 DEF:var={rrd1}:cwrSnapshotType:AVERAGE \
 LINE1:var#00ccff:"cwrSnapshotType" \
 GPRINT:var:AVERAGE:"Avg\\: %8.2lf %s" \
 GPRINT:var:MIN:"Min\\: %8.2lf %s" \
 GPRINT:var:MAX:"Max\\: %8.2lf %s\\n"

